import React from 'react';
import './Footer.css';

class Footer extends React.Component{
  render(){
    return(
      <footer className="footer">
        Elevation Software 2020<br/>
        (678) 923 7694<br/>
        info@elevationsoftware.io
        <div id="bar"></div>
        <div>COPYRIGHT 2020, ELEVATION SOFTWARRE SERVICE INC.</div>
      </footer>
    );
  }
}
export default Footer;
